ame":{"simpleText":"Tsonga"}},{"languageCode":"tn","languageName":{"simpleText":"Tswana"}},{"languageCode":"tum","languageName":{"simpleText":"Tumbuka"}},{"languageCode":"tr","languageName":{"simpleText":"Turkish"}},{"languageCode":"tk","languageName":{"simpleText":"Turkmen"}},{"languageCode":"uk","languageName":{"simpleText":"Ukrainian"}},{"languageCode":"ur","languageName":{"simpleText":"Urdu"}},{"languageCode":"ug","languageName":{"simpleText":"Uyghur"}},{"languageCode":"uz","languageName":{"simpleText":"Uzbek"}},{"languageCode":"ve","languageName":{"simpleText":"Venda"}},{"languageCode":"vi","languageName":{"simpleText":"Vietnamese"}},{"languageCode":"war","languageName":{"simpleText":"Waray"}},{"languageCode":"cy","languageName":{"simpleText":"Welsh"}},{"languageCode":"fy","languageName":{"simpleText":"Western Frisian"}},{"languageCode":"wo","languageName":{"simpleText":"Wolof"}},{"languageCode":"xh","languageName":{"simpleText":"Xhosa"}},{"languageCode":"yi","languageName":{"simpleText":"Yiddish"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"K81-SLUFo9c","title":"NEVER DO PULL-UPS LIKE THIS! | 10 Most Common Mistakes","lengthSeconds":"714","keywords":["how to do pull-ups","how to do pullups","increase pull-ups","increase pullups","get a strong pullups","get stronger at pullups","get stronger at pull-ups","increase pull-up strength","how to do a pullup","how to do a pull-up","pull-up mistakes","pullup mistakes","pull-up form","proper pull-up form","proper pullup form","pullup form","pullup tutorial","pull-up tutorial","how to do more pull-ups","how to do more pullups","athleanx","athlean x","jeff cavaliere"],"channelId":"UCe0TLA0EsQbE-MjuHXevj2A","isOwnerViewing":false,"shortDescription":"The pull-up is one of the most commonly performed, and misperformed, exercises in the gym. In this video, Im going to show you how to never do them incorrectly again and give you the fixes for the 10 most common pullup mistakes.  Whether you can do 10 pull-ups or more now or struggle to do one, youll find this incredibly helpful and I guarantee you will be doing more reps by the time the video is over.\n\n60% off all AX programs - http://athleanx.com/x/120-workouts\nSubscribe to this channel here - http://bit.ly/2b0coMW\n\nThe first thing you need to be aware of is how you are gripping the bar. If you grip too narrow you will shift the focus of the movement from the stronger back muscles to the weaker muscles of the forearms. You want to make sure you are just outside of shoulder width with the hand placement for optimal performance on this exercise.\n\nThat said, the brachioradialis and brachialis are muscles that are going to be contributing to the pullup and your ability to do the most reps possible so you are going to need to train them. You just dont want them being the main drivers of the exercise. To supplement your back muscles in the exercise, be sure to include some cross body hammer curls as shown to increase the strength of the forearms and your overall strength on the pullup.\n\nRegarding the grip placement, it isnt enough to just get the hand spacing down. You also want to be sure that you direct your pressure in the right way. Most people simply pull straight down on the bar or worse, they pull outwards because theyve been told this will increase the activation of the lats. Both of these arent optimal. The best thing you can do is squeeze your hands inward towards each other and down at the same time. This will engage much more upper body muscle activation that will make your body feel as if it is floating up above the bar on every rep, instantly.\n\nMuch of this has to do with plugging kinetic looseness (or energy leaks as I call them). You can take this even a step further by contracting other areas of your body that often get ignored during the exercise like your legs, ankles and core. Instead of dangling from the bar and letting your knees hang loosely, tighten you quads, point your feet down and really contract your core muscles and you will see an instant improvement in your ability to lift your body up over the bar.\n\nNow you dont want to take these measures and then let it all loosen up when you get to the bottom of the rep. Most importantly, you do not want to get lax during the hanging portion of the pullup. This will place too much strain on the shoulders and is called unpacking. Instead, even though you want to get fully straightened at the elbows you want to keep your shoulder blades pulled down and back to create shoulder stability. This will allow for a lifetime of injury free pullups and more growth from the exercise.\n\nThere are other biomechanical flaws that you will want to avoid with your pullups that I cover here but I also want to point out a couple of the programming issues that are often done incorrectly as well. For instance, you dont want to always save your pullups for the end of your workout. Too often, because they are a bodyweight exercise, we save them for after we have already done our rows, deadlifts or pulldowns. You will never get the most out of the exercise when done in a fatigued state like this. Try moving them to the front of your workout and you will be surprised at how quickly you see gains just by making the switch.\n\nFinally, the exercise like any other, will respond to intensification techniques like drop sets and changes in the weight used during it. Use a band to accommodate your fatigue and get more total reps done in a workout - either as a drop set or as a simple lightening of the load as you would with any other traditional back exercise in your workout.\n\nIf youre looking for a program that will help you to do many more pullups while at the same time getting you in the best overall shape of your life, head to athleanx.com at the link below and follow the same step by step training that has created ripped athletic bodies for men and women of all ages and all levels of athleticism. \n\nFor more videos on how to increase your pullups and proper pull-up form, be sure to subscribe to our channel here on youtube at the link below and make sure to turn on your notifications so you never miss a new video when its published.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/K81-SLUFo9c/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBvuGaO8qNf0ps5G95-BvJv2S2psg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/K81-SLUFo9c/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLB3kHpfKeKcmt-RVOhQU2Uf7qKBuA","width":196,"height":110},{"url":"https://i.ytimg.com/vi/K81-SLUFo9c/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLC64_ylL28n7x__kVhXLyuDYz4UaQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/K81-SLUFo9c/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCkDzq08l75M-UK6SPlqoj_L1reOg","width":336,"height":188},{"url":"https://i.ytimg.com/vi/K81-SLUFo9c/maxresdefault.jpg","width":1920,"height":1080}]},"allowRatings":true,"viewCount":"7256450","author":"ATHLEAN-X","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"0","endTimeMs":"694000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/e0TLA0EsQbE-MjuHXevj2A/featured_channel.jpg?v=632fce9c","width":40,"height":40}]},"trackingParams":"CGUQ8zciEwji7NjYtu2HAxWqR0gAHV33FyY=","navigationEndpoint":{"clickTrackingParams":"CGUQ8zciEwji7NjYtu2HAxWqR0gAHV33FyYyAml2","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCe0TLA0EsQbE-MjuHXevj2A","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCe0TLA0EsQbE-MjuHXevj2A"}},"channelName":"ATHLEAN-X","subscrib 5MYLcUVShLHlz2JWR4eDRw","recommendedLevel":2,"highResolutionRecommendedLevel":3}},"microformat":{"playerMicroformatRenderer":{"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/K81-SLUFo9c/maxresdefault.jpg","width":1280,"height":720}]},"embed":{"iframeUrl":"https://www.youtube.com/embed/K81-SLUFo9c","width":1280,"height":720},"title":{"simpleText":"NEVER DO PULL-UPS LIKE THIS! | 10 Most Common Mistakes"},"description":{"simpleText":"The pull-up is one of the most commonly performed, and misperformed, exercises in the gym. In this video, Im going to show you how to never do them incorrectly again and give you the fixes for the 10 most common pullup mistakes.  Whether you can do 10 pull-ups or more now or struggle to do one, youll find this incredibly helpful and I guarantee you will be doing more reps by the time the video is over.\n\n60% off all AX programs - http://athleanx.com/x/120-workouts\nSubscribe to this channel here - http://bit.ly/2b0coMW\n\nThe first thing you need to be aware of is how you are gripping the bar. If you grip too narrow you will shift the focus of the movement from the stronger back muscles to the weaker muscles of the forearms. You want to make sure you are just outside of shoulder width with the hand placement for optimal performance on this exercise.\n\nThat said, the brachioradialis and brachialis are muscles that are going to be contributing to the pullup and your ability to do the most reps possible so you are going to need to train them. You just dont want them being the main drivers of the exercise. To supplement your back muscles in the exercise, be sure to include some cross body hammer curls as shown to increase the strength of the forearms and your overall strength on the pullup.\n\nRegarding the grip placement, it isnt enough to just get the hand spacing down. You also want to be sure that you direct your pressure in the right way. Most people simply pull straight down on the bar or worse, they pull outwards because theyve been told this will increase the activation of the lats. Both of these arent optimal. The best thing you can do is squeeze your hands inward towards each other and down at the same time. This will engage much more upper body muscle activation that will make your body feel as if it is floating up above the bar on every rep, instantly.\n\nMuch of this has to do with plugging kinetic looseness (or energy leaks as I call them). You can take this even a step further by contracting other areas of your body that often get ignored during the exercise like your legs, ankles and core. Instead of dangling from the bar and letting your knees hang loosely, tighten you quads, point your feet down and really contract your core muscles and you will see an instant improvement in your ability to lift your body up over the bar.\n\nNow you dont want to take these measures and then let it all loosen up when you get to the bottom of the rep. Most importantly, you do not want to get lax during the hanging portion of the pullup. This will place too much strain on the shoulders and is called unpacking. Instead, even though you want to get fully straightened at the elbows you want to keep your shoulder blades pulled down and back to create shoulder stability. This will allow for a lifetime of injury free pullups and more growth from the exercise.\n\nThere are other biomechanical flaws that you will want to avoid with your pullups that I cover here but I also want to point out a couple of the programming issues that are often done incorrectly as well. For instance, you dont want to always save your pullups for the end of your workout. Too often, because they are a bodyweight exercise, we save them for after we have already done our rows, deadlifts or pulldowns. You will never get the most out of the exercise when done in a fatigued state like this. Try moving them to the front of your workout and you will be surprised at how quickly you see gains just by making the switch.\n\nFinally, the exercise like any other, will respond to intensification techniques like drop sets and changes in the weight used during it. Use a band to accommodate your fatigue and get more total reps done in a workout - either as a drop set or as a simple lightening of the load as you would with any other traditional back exercise in your workout.\n\nIf youre looking for a program that will help you to do many more pullups while at the same time getting you in the best overall shape of your life, head to athleanx.com at the link below and follow the same step by step training that has created ripped athletic bodies for men and women of all ages and all levels of athleticism. \n\nFor more videos on how to increase your pullups and proper pull-up form, be sure to subscribe to our channel here on youtube at the link below and make sure to turn on your notifications so you never miss a new video when its published."},"lengthSeconds":"715","ownerProfileUrl":"http://www.youtube.com/@athleanx","externalChannelId":"UCe0TLA0EsQbE-MjuHXevj2A","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT", dhFV","defaultExpanded":false,"descriptionCollapsedLines":3,"showMoreCommand":{"clickTrackingParams":"CPEBEM2rARgBIhMI1JLZ2LbthwMVK01IAB0XdhFV","commandExecutorCommand":{"commands":[{"clickTrackingParams":"CPEBEM2rARgBIhMI1JLZ2LbthwMVK01IAB0XdhFV","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_EXPANDED"}},{"clickTrackingParams":"CPEBEM2rARgBIhMI1JLZ2LbthwMVK01IAB0XdhFV","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CPEBEM2rARgBIhMI1JLZ2LbthwMVK01IAB0XdhFV","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"The pull-up is one of the most commonly performed, and misperformed, exercises in the gym. In this video, Im going to show you how to never do them incorrectly again and give you the fixes for the 10 most common pullup mistakes.  Whether you can do 10 pull-ups or more now or struggle to do one, youll find this incredibly helpful and I guarantee you will be doing more reps by the time the video is over.\n\n60% off all AX programs - http://athleanx.com/x/120-workouts\nSubscribe to this channel here - http://bit.ly/2b0coMW\n\nThe first thing you need to be aware of is how you are gripping the bar. If you grip too narrow you will shift the focus of the movement from the stronger back muscles to the weaker muscles of the forearms. You want to make sure you are just outside of shoulder width with the hand placement for optimal performance on this exercise.\n\nThat said, the brachioradialis and brachialis are muscles that are going to be contributing to the pullup and your ability to do the most reps possible so you are going to need to train them. You just dont want them being the main drivers of the exercise. To supplement your back muscles in the exercise, be sure to include some cross body hammer curls as shown to increase the strength of the forearms and your overall strength on the pullup.\n\nRegarding the grip placement, it isnt enough to just get the hand spacing down. You also want to be sure that you direct your pressure in the right way. Most people simply pull straight down on the bar or worse, they pull outwards because theyve been told this will increase the activation of the lats. Both of these arent optimal. The best thing you can do is squeeze your hands inward towards each other and down at the same time. This will engage much more upper body muscle activation that will make your body feel as if it is floating up above the bar on every rep, instantly.\n\nMuch of this has to do with plugging kinetic looseness (or energy leaks as I call them). You can take this even a step further by contracting other areas of your body that often get ignored during the exercise like your legs, ankles and core. Instead of dangling from the bar and letting your knees hang loosely, tighten you quads, point your feet down and really contract your core muscles and you will see an instant improvement in your ability to lift your body up over the bar.\n\nNow you dont want to take these measures and then let it all loosen up when you get to the bottom of the rep. Most importantly, you do not want to get lax during the hanging portion of the pullup. This will place too much strain on the shoulders and is called unpacking. Instead, even though you want to get fully straightened at the elbows you want to keep your shoulder blades pulled down and back to create shoulder stability. This will allow for a lifetime of injury free pullups and more growth from the exercise.\n\nThere are other biomechanical flaws that you will want to avoid with your pullups that I cover here but I also want to point out a couple of the programming issues that are often done incorrectly as well. For instance, you dont want to always save your pullups for the end of your workout. Too often, because they are a bodyweight exercise, we save them for after we have already done our rows, deadlifts or pulldowns. You will never get the most out of the exercise when done in a fatigued state like this. Try moving them to the front of your workout and you will be surprised at how quickly you see gains just by making the switch.\n\nFinally, the exercise like any other, will respond to intensification techniques like drop sets and changes in the weight used during it. Use a band to accommodate your fatigue and get more total reps done in a workout - either as a drop set or as a simple lightening of the load as you would with any other traditional back exercise in your workout.\n\nIf youre looking for a program that will help you to do many more pullups while at the same time getting you in the best overall shape of your life, head to athleanx.com at the link below and follow the same step by step training that has created ripped athletic bodies for men and women of all ages and all levels of athleticism. \n\nFor more videos on how to increase your pullups and proper pull-up form, be sure to subscribe to our channel here on youtube at the link below and make sure to turn on your notifications so you never miss a new video when its published.","commandRuns":[{"startIndex":435,"length":34,"onTap":{"innertubeCommand":{"clickTrackingParams":"CPEBEM2rARgBIhMI1JLZ2LbthwMVK01IAB0XdhFVSNfHlqiLyd_mKw==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbHlkcGNuQnc4c254QUVya1lhOFZpaEZ1N2g2QXxBQ3Jtc0ttVkRaWkNFQ09WV3Z0WWNMRnRSZERIOEZfVzFGSkFEZTlrd3NqUDd4X0hIamVrbTRCNGhJY2JRcGkxVVJyZm9HRk1mcWdkbmRHX0JWdUFPWUs1aDNqTS1ES0FRcGNqSDZmMFR4RFJPcnoyc1NDMGN1NA\u0026q=http%3A%2F%2Fathleanx.com%2Fx%2F120-workouts\u0026v=K81-SLUFo9c","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUF :"Jan 5, 2020"}}],"channelNavigationEndpoint":{"clickTrackingParams":"CBsQ040EGAQiEwjUktnYtu2HAxUrTUgAHRd2EVU=","commandMetadata":{"webCommandMetadata":{"url":"/@athleanx","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCe0TLA0EsQbE-MjuHXevj2A","canonicalBaseUrl":"/@athleanx"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/Iz_-2YBK5LwyfrC-fbk1vbjCuMYLAwobmUbxTObYKPu9ceo7DeoljkExIuw9XBmLvUh7w8yy=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"simpleText":"Show more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"The pull-up is one of the most commonly performed, and misperformed, exercises in the gym. In this video, Im going to show you how to never do them incorrectly again and give you the fixes for the 10 most common pullup mistakes.  Whether you can do 10 pull-ups or more now or struggle to do one, youll find this incredibly helpful and I guarantee you will be doing more reps by the time the video is over.\n\n60% off all AX programs - http://athleanx.com/x/120-workouts\nSubscribe to this channel here - http://bit.ly/2b0coMW\n\nThe first thing you need to be aware of is how you are gripping the bar. If you grip too narrow you will shift the focus of the movement from the stronger back muscles to the weaker muscles of the forearms. You want to make sure you are just outside of shoulder width with the hand placement for optimal performance on this exercise.\n\nThat said, the brachioradialis and brachialis are muscles that are going to be contributing to the pullup and your ability to do the most reps possible so you are going to need to train them. You just dont want them being the main drivers of the exercise. To supplement your back muscles in the exercise, be sure to include some cross body hammer curls as shown to increase the strength of the forearms and your overall strength on the pullup.\n\nRegarding the grip placement, it isnt enough to just get the hand spacing down. You also want to be sure that you direct your pressure in the right way. Most people simply pull straight down on the bar or worse, they pull outwards because theyve been told this will increase the activation of the lats. Both of these arent optimal. The best thing you can do is squeeze your hands inward towards each other and down at the same time. This will engage much more upper body muscle activation that will make your body feel as if it is floating up above the bar on every rep, instantly.\n\nMuch of this has to do with plugging kinetic looseness (or energy leaks as I call them). You can take this even a step further by contracting other areas of your body that often get ignored during the exercise like your legs, ankles and core. Instead of dangling from the bar and letting your knees hang loosely, tighten you quads, point your feet down and really contract your core muscles and you will see an instant improvement in your ability to lift your body up over the bar.\n\nNow you dont want to take these measures and then let it all loosen up when you get to the bottom of the rep. Most importantly, you do not want to get lax during the hanging portion of the pullup. This will place too much strain on the shoulders and is called unpacking. Instead, even though you want to get fully straightened at the elbows you want to keep your shoulder blades pulled down and back to create shoulder stability. This will allow for a lifetime of injury free pullups and more growth from the exercise.\n\nThere are other biomechanical flaws that you will want to avoid with your pullups that I cover here but I also want to point out a couple of the programming issues that are often done incorrectly as well. For instance, you dont want to always save your pullups for the end of your workout. Too often, because they are a bodyweight exercise, we save them for after we have already done our rows, deadlifts or pulldowns. You will never get the most out of the exercise when done in a fatigued state like this. Try moving them to the front of your workout and you will be surprised at how quickly you see gains just by making the switch.\n\nFinally, the exercise like any other, will respond to intensification techniques like drop sets and changes in the weight used during it. Use a band to accommodate your fatigue and get more total reps done in a workout - either as a drop set or as a simple lightening of the load as you would with any other traditional back exercise in your workout.\n\nIf youre looking for a program that will help you to do many more pullups while at the same time getting you in the best overall shape of your life, head to athleanx.com at the link below and follow the same step by step training that has created ripped athletic bodies for men and women of all ages and all levels of athleticism. \n\nFor more videos on how to increase your pullups and proper pull-up form, be sure to subscribe to our channel here on youtube at the link below and make sure to turn on your notifications so you never miss a new video when its published.","commandRuns":[{"startIndex":435,"length":34,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBsQ040EGAQiEwjUktnYtu2HAxUrTUgAHRd2EVVI18eWqIvJ3-Yr","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnVyQ0F3RFNOcnJhc0dQYXN1TGdNS0ZsY2VZZ3xBQ3Jtc0tsVFBoM0JZQUxZVk90R1RtRHpSZ1R1cS0yOWFya0ppSVlEdUN4Y1Y1S0J4emYwbmdyRkkyRzEzRmhHcW1UX3NlZmFhOWZJNFZkcGQ0Y3VacEtkM2hrZk5yT3ZLdEN3d04tVGpNaWZMWlA1WGpZUWRBWQ\u0026q=http%3A%2F%2Fathleanx.com%2Fx%2F120-workouts\u0026v=K81-SLUFo9c","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnVyQ0F3RFNOcnJhc0dQYXN1TGdNS0ZsY2VZZ3xBQ3Jtc0tsVFBoM0JZQUxZVk90R1RtRHpSZ1R1cS0yOWFya0ppSVlEdUN4Y1Y1S0J4emYwbmdyRkkyRzEzRmhHcW1UX3Nl
